import React from 'react';
import './work.css';

function Work(props) {
    const work = props.data;
    const listWorks = work.map((item, i)=>
         <div className ="ListWork" key = {i} >
            <div className="Position">
                {item.position.toUpperCase()} {item.fe_desde} - {item.fe_hasta}
            </div>
            <div className = "Company">
                {item.company.toUpperCase()} 
            </div>
            <div className = "Description">
                {item.description}
            </div>
            <hr></hr>
         </div>
    )
    return (
        <div className="Work">
            <span className="subtitle">EXPERIENCIA</span>
            <hr></hr>
            {listWorks}
        </div>
    )
}

export default Work;
